/* eslint-disable react/react-in-jsx-scope */
import BootstrapTable from 'react-bootstrap-table-next';

const products = [2,3,4 ];
const columns = [{
  dataField: 'id',
  text: 'Product ID'
}, {
  dataField: 'name',
  text: 'Product Name'
}, {
  dataField: 'price',
  text: 'Product Price'
}];

export default () =>
  <BootstrapTable keyField='id' data={ products } columns={ columns } />
